export default function App(props) {

    let users=[];
    for(let i = 0; i < props.length; i++){
        users[users.length]=(Object.values(props[i]));
    }
    console.log(users);
    return (
        <div>
            {users.map((name, age, gen) => <div><h1>{name}</h1><h2>{age}</h2><h2>{gen}</h2></div>)}
        </div>
    )
}
